import React, { useState } from 'react';
import { FaUser, FaSignOutAlt, FaCog, FaChevronDown, FaChevronUp } from 'react-icons/fa';
import './UserProfile.css';

const UserProfile = ({ user, onLogout }) => {
  const [showDetails, setShowDetails] = useState(false);
  const [isEditing, setIsEditing] = useState(false);
  const [editedName, setEditedName] = useState(user.name);

  const handleUpdateProfile = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await fetch('http://localhost:8000/api/users/profile', {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        },
        body: JSON.stringify({
          name: editedName
        })
      });
      
      if (response.ok) {
        // Update local storage with new name
        const demoUser = JSON.parse(localStorage.getItem('demoUser'));
        if (demoUser) {
          demoUser.name = editedName;
          localStorage.setItem('demoUser', JSON.stringify(demoUser));
        }
        setIsEditing(false);
      } else {
        console.error('Error updating profile:', response.statusText);
        // Demo mode - update anyway
        const demoUser = JSON.parse(localStorage.getItem('demoUser'));
        if (demoUser) {
          demoUser.name = editedName;
          localStorage.setItem('demoUser', JSON.stringify(demoUser));
        }
        setIsEditing(false);
      }
    } catch (error) {
      console.error('Error updating profile:', error);
      // Demo mode - update anyway
      const demoUser = JSON.parse(localStorage.getItem('demoUser'));
      if (demoUser) {
        demoUser.name = editedName;
        localStorage.setItem('demoUser', JSON.stringify(demoUser));
      }
      setIsEditing(false);
    }
  };

  const toggleDetails = () => {
    setShowDetails(!showDetails);
  };

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('tr-TR', {
      year: 'numeric',
      month: 'long',
      day: 'numeric'
    });
  };

  return (
    <div className="user-profile">
      <div className="user-info" onClick={toggleDetails}>
        <div className="user-avatar">
          <FaUser />
        </div>
        <div className="user-details">
          {isEditing ? (
            <input
              type="text"
              value={editedName}
              onChange={(e) => setEditedName(e.target.value)}
              className="edit-name-input"
              onKeyPress={(e) => {
                if (e.key === 'Enter') {
                  handleUpdateProfile();
                }
              }}
              autoFocus
            />
          ) : (
            <span className="user-name" onDoubleClick={() => setIsEditing(true)}>
              {editedName}
            </span>
          )}
          <span className="user-email">{user.email}</span>
        </div>
        <button className="toggle-details-button">
          {showDetails ? <FaChevronUp /> : <FaChevronDown />}
        </button>
      </div>
      
      {showDetails && (
        <div className="user-details-expanded">
          <div className="user-detail-item">
            <span className="detail-label">Kullanıcı ID:</span>
            <span className="detail-value">{user.id}</span>
          </div>
          <div className="user-detail-item">
            <span className="detail-label">Katılma Tarihi:</span>
            <span className="detail-value">
              {formatDate(user.created_at || new Date().toISOString())}
            </span>
          </div>
          <div className="user-actions">
            <button className="action-button settings-button">
              <FaCog />
              <span>Ayarlar</span>
            </button>
          </div>
        </div>
      )}
      
      <button 
        className="logout-button" 
        onClick={onLogout}
      >
        <FaSignOutAlt />
        <span>Çıkış Yap</span>
      </button>
    </div>
  );
};

export default UserProfile;
